@iphydf this would require client support, and thereby allowing clients to be much more careful than a user would. I actually like that idea a lot more. 

This way, if you're somehow able to trick a user into writing `export TOX_KEY_DIR` they still need to enable a feature in their client. Before the logging callback, this would be problematic, but now with the new logging features, it'd be much easier.

Also we should consider adding an additional tox setting, to even enable this, so you need to do something at compile time, and run time.
